    Aktualności

        </div><div id=""od-news-top-bar"" class=""main-top-bar""><form id=""od-news-search-form"" method=""get""><div class=""main-filter-input""><input class=""text"" type=""text"" name=""q"" id=""od-news-search-q""/><input class=""reset"" type=""reset"" id=""od-news-search-reset"" value=""X"" style=""display:none;""/></div></form><div class=""od-news-navigator""><a href=""/feeds/news/"" title=""Aktualności RSS"" id=""od-news-rss-icon""><img src=""/site_media/images/rss.png"" alt=""RSS""/></a></div><div style=""clear: both;""></div></div><div id=""main-content-container"" class=""row show-grid sidebar-right""><div class=""span11 columns""><div id=""main-content""><h2>Aktualności</h2><div id=""news-content""><div class=""od-news-list""><div class=""od-news-item""><div class=""od-news-header""><h3>przeniesienie wykładu MDL (śr 14-16) z s. 119 do s.EM w IM</h3><span class=""od-news-date"">Piątek, 02.12.2016 - 12:23</span></div><div class=""od-news-body""><p>W najbliższą środę 7.XII.2016 wykład MDL zostanie przeniesiony z sali 119 do sali EM w IM.</p></div><div class=""od-news-footer"">
                            Anna Smolińska
                        </div></div><div class=""od-news-item""><div class=""od-news-header""><h3>Rekrutacja na specjalność Inteligentne Przetwarzanie Danych</h3><span class=""od-news-date"">Wtorek, 29.11.2016 - 22:23</span></div><div class=""od-news-body""><p>Trwa rekrutacja na specjalność Inteligentne Przetwarzanie Danych na studiach II stopnia.</p><p><a href=""http://cirg.ii.uni.wroc.pl/wp-content/uploads/2015/06/Nabor-2016-Ogloszenie-o-naborze.pdf"" target=""_blank"">Ogłoszenie o naborze</a></p><p>Więcej informacji znajdą Państwo na stronie&nbsp;<a href=""http://cirg.ii.uni.wroc.pl/?page_id=51"" target=""_blank"">Pracowni Inteligencji Obliczeniowej</a>.</p></div><div class=""od-news-footer"">
                            Małgorzata Biernacka
                        </div></div><div class=""od-news-item""><div class=""od-news-header""><h3>Wypisy dyrektorskie w semestrze zimowym 2016/17</h3><span class=""od-news-date"">Poniedziałek, 14.11.2016 - 13:47</span></div><div class=""od-news-body""><p>Do <strong>9 grudnia</strong> tego roku można skorzystać z wypisu dyrektorskiego. W tym celu trzeba wysłać do mnie e-mail (najlepiej z tematem ""Wypis dyrektorski"") z informacją, o jaki przedmiot chodzi (nazwa przedmiotu i grupa ćwiczeniowa/lab.). E-mail musi być wysłany z adresu studenta podanego w &nbsp;zapisach.</p><p>Przypominam, że z wypisu można skorzystać raz w czasie studi&oacute;w 1-go stopnia i raz w czasie studi&oacute;w 2-go stopnia.</p></div><div class=""od-news-footer"">
                            Małgorzata Biernacka
                        </div></div><div class=""od-news-item""><div class=""od-news-header""><h3>zmiana sali </h3><span class=""od-news-date"">Piątek, 04.11.2016 - 11:31</span></div><div class=""od-news-body""><p><strong>Kurs: Wstęp do programowania w języku Python grupa M. Gańczorza śr 18-20 z sali 107 na salę 108.<br /></strong></p></div><div class=""od-news-footer"">
                            Anna Smolińska
                        </div></div><div class=""od-news-item""><div class=""od-news-header""><h3>Zamiana sal 119/25 w pt 10-12</h3><span class=""od-news-date"">Środa, 12.10.2016 - 14:30</span></div><div class=""od-news-body""><p>Od najbliższego piątku nastąpi zamiana sal na wykłady:</p><p>Psychologia internetu - sala 25</p><p>Kurs języka Ruby - sala 119</p></div><div class=""od-news-footer"">
                            Anna Smolińska
                        </div></div><div class=""od-news-item""><div class=""od-news-header""><h3>Programowanie funkcyjne - zmiana terminu pracowni</h3><span class=""od-news-date"">Piątek, 07.10.2016 - 14:08</span></div><div class=""od-news-body""><p>Termin zajęć grupy Filipa Sieczkowskiego został przeniesiony z wtorku 8:00-10:00 na środę 10:00-12:00 (s.110).</p></div><div class=""od-news-footer"">
                            Małgorzata Biernacka
                        </div></div><div class=""od-news-item""><div class=""od-news-header""><h3>Kurs: Podstawowy warsztat informatyka</h3><span class=""od-news-date"">Czwartek, 06.10.2016 - 13:21</span></div><div class=""od-news-body""><p>Zainteresowanych student&oacute;w informuję, że dwie dotąd nieobsadzone grupy z tego przedmiotu zyskały prowadzącego, ale ich termin uległ zmianie na czwartek, godz. 14-15 i 15-16. </p></div><div class=""od-news-footer"">
                            Małgorzata Biernacka
                        </div></div><div class=""od-news-item""><div class=""od-news-header""><h3>Obecność na zajęciach</h3><span class=""od-news-date"">Środa, 05.10.2016 - 15:47</span></div><div class=""od-news-body""><p>W przypadku niekt&oacute;rych przedmiot&oacute;w, kt&oacute;re cieszą się dużą popularnością (np. seminari&oacute;w) nie ma niestety możliwości zwiększenia limit&oacute;w grup lub utworzenia nowych, żeby zapisać wszystkich chętnych. Osoby, kt&oacute;re są już <span style=""text-decoration: underline;"">zapisane</span> na takie popularne zajęcia - i zależy im na nich - szczeg&oacute;lnie proszę o obecność na pierwszych zajęciach w semestrze, ponieważ w przypadku nieobecności prowadzący może poprosić o wypisanie takiej osoby z grupy, aby na jej miejsce wpisać osobę z kolejki. Prowadzący nie musi skorzystać z tej możliwości, ale może, aby umożliwić udział w zajęciach osobom rzeczywiście zainteresowanym.</p><p>(Oczywiście r&oacute;żne mogą być przyczyny nieobecności - proszę rozmawiać indywidualnie z prowadzącymi.)</p><p>&nbsp;</p></div><div class=""od-news-footer"">
                            Małgorzata Biernacka
                        </div></div><div class=""od-news-item""><div class=""od-news-header""><h3>Zmiany w grupach</h3><span class=""od-news-date"">Wtorek, 04.10.2016 - 11:16</span></div><div class=""od-news-body""><p>Zostały utworzone nowe grupy do przedmiot&oacute;w (niekt&oacute;re jeszcze bez termin&oacute;w lub prowadzących):</p><ul><li>Kurs: Podstawowy warsztat informatyka - 4 grupy</li><li>Kurs: Wstęp do programowania w języku Python - 1 grupa</li><li>Programowanie funkcyjne - 1 grupa</li><li>Sztuczna inteligencja w grach - 1 grupa</li></ul><p>Zlikwidowane zostaną grupy do przedmiot&oacute;w:</p><ul><li>Algorytmy grafowe - wszystkie, w związku z wycofaniem przedmiotu</li><li>Matematyka dyskretna (M) - grupa P. Schmidta</li><li>Podstawy grafiki komputerowej - grupa A. Łukaszewskiego</li></ul><p>Student&oacute;w zapisanych do likwidowanych grup proszę o przepisanie się do innych.</p></div><div class=""od-news-footer"">
                            Małgorzata Biernacka
                        </div></div><div class=""od-news-item""><div class=""od-news-header""><h3>Limity dla ISIMu</h3><span class=""od-news-date"">Poniedziałek, 03.10.2016 - 23:51</span></div><div class=""od-news-body""><p>Jutro (we wtorek) ok. południa zostaną zniesione limity dla student&oacute;w ISIMu, żeby umożliwić studentom informatyki zapisanie się na zajęcia cieszące się dużym zainteresowaniem (szczeg&oacute;lnie kursy: <em>Wstęp do programowania w języku Python</em> i <em>Wybrane elementy praktyki projektowania oprogramowania</em>). Student&oacute;w ISIMu proszę o przemyślenie i ewentualną korektę swojego wyboru.</p></div><div class=""od-news-footer"">
                            Małgorzata Biernacka
                        </div></div><div class=""od-news-item""><div class=""od-news-header""><h3>Algorytmy grafowe - przedmiot wycofany</h3><span class=""od-news-date"">Poniedziałek, 03.10.2016 - 23:32</span></div><div class=""od-news-body""><p>Z przykrością informuję, że w bieżącym semestrze przedmiot <em>Algorytmy grafowe</em> nie zostanie przeprowadzony. Gdyby ktoś ze student&oacute;w zapisanych na ten przedmiot miał z tego powodu problem z ułożeniem planu, proszę o kontakt.</p></div><div class=""od-news-footer"">
                            Małgorzata Biernacka
                        </div></div><div class=""od-news-item""><div class=""od-news-header""><h3>Logika dla informatyków - termin pierwszego repetytorium</h3><span class=""od-news-date"">Sobota, 01.10.2016 - 17:01</span></div><div class=""od-news-body""><p>Pierwsze repetytorium z Logiki dla informatyk&oacute;w odbędzie się <strong>11 października</strong>.</p></div><div class=""od-news-footer"">
                            Małgorzata Biernacka
                        </div></div><div class=""od-news-item""><div class=""od-news-header""><h3>Do studentów pierwszego roku informatyki i ISIM</h3><span class=""od-news-date"">Czwartek, 29.09.2016 - 18:27</span></div><div class=""od-news-body""><ol><li>Studenci, kt&oacute;rzy nie odebrali dzisiaj karteczki z hasłem mogą ją otrzymać jutro w czasie spotkania z tutorem. Do systemu zapis&oacute;w można się zalogować bez znajomości tego hasła, korzystając z opcji odzyskiwania hasła (loginem jest numer indeksu).</li><li>Proszę o zalogowanie się do serwisu SKOS (skos.ii.uni.wroc.pl) - są tam już Państwo zapisani do kursu ""Pierwsze zajęcia 2016"", gdzie znajdują się przydatne dla Państwa informacje. Dostęp do SKOS (i usosweb) można uzyskać poprzez procedurę ""zapomniane hasło"" podając sw&oacute;j adres mailowy z rekrutacji. </li><li>Dostęp do konta pocztowego w domenie uwr.edu.pl można uzyskać resetując hasło na stronie portal.uwr.edu.pl</li><li>Czasy otwarcia zapis&oacute;w dla Państwa są przydzielone wg klucza alfabetycznego (pierwsza litera nazwiska):</li></ol><p style=""padding-left: 60px;"">A - J -&gt; 13:30</p><p style=""padding-left: 60px;"">K - P -&gt; 14:00</p><p style=""padding-left: 60px;"">R - Z -&gt; 14:30</p><p style=""padding-left: 30px;"">(Proszę o zweryfikowanie godziny na swojej karteczce.)</p></div><div class=""od-news-footer"">
                            Małgorzata Biernacka
                        </div></div><div class=""od-news-item""><div class=""od-news-header""><h3>zapisy w II i IM</h3><span class=""od-news-date"">Czwartek, 29.09.2016 - 13:40</span></div><div class=""od-news-body""><div class=""gmail_default"" style=""font-family: verdana,sans-serif; font-size: small; color: #000000; display: inline;"">Studenci matematyki, kt&oacute;rzy chcieliby zapisać się poprzez system zapis&oacute;w na zajęcia prowadzone w II powinni wysłać maila na adres: zapisy @ ii.uni.wroc.pl z prośbą o utworzenie konta w systemie zapis&oacute;w. Studenci informatyki, kt&oacute;rzy chcieliby zapisać się na zajęcia prowadzone w IM powinni zgłosić się do p. Elżbiety Kalinowskiej z IM (pok. 315 w godz. 9-14.30).​<span style=""font-size: x-small;""><span style=""font-family: verdana,sans-serif;""></span></span></div><div class=""gmail_default"" style=""font-family: verdana,sans-serif; font-size: small; color: #000000; display: inline;""><span style=""font-size: x-small;""><span style=""font-family: verdana,sans-serif;""><br /></span></span></div></div><div class=""od-news-footer"">
                            Anna Smolińska
